import Icon from "@mui/material/Icon";
import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";
import { useState } from "react";
import SuiBox from "components/SuiBox";
import SuiButton from "components/SuiButton";
import { Link } from "react-router-dom";
import CustomerSupport from "examples/Icons/CustomerSupport";

function Analytics() {
    const [menu, setMenu] = useState(null);

    const openMenu = (event) => setMenu(event.currentTarget);
    const closeMenu = () => setMenu(null);

    const renderMenu = (
        <Menu
            anchorEl={menu}
            transformOrigin={{ vertical: "top", horizontal: "left" }}
            open={Boolean(menu)}
            onClose={closeMenu}
            keepMounted
        >
            <MenuItem onClick={closeMenu}> <Link to="/authentication/error/Sidemenu" style={{ color: 'white' }}>Edit User Profile</Link></MenuItem>

            <MenuItem onClick={closeMenu}><Link to="/authentication/error/Menupage" style={{ color: 'white' }}>Update User Settings</Link></MenuItem>

            <MenuItem onClick={closeMenu}><Link to="/authentication/error/Menupage3" style={{ color: 'white' }}>Update Ideal Asset Allocation</Link></MenuItem>

            <MenuItem onClick={closeMenu}><Link to="/authentication/error/Menupage4" style={{ color: 'white' }}>Upload Insurance file(s)</Link></MenuItem>

            <MenuItem onClick={closeMenu}><Link to="/authentication/error/Menupage5" style={{ color: 'white' }}>Add Family Member</Link></MenuItem>

            <MenuItem onClick={closeMenu}><Link to="/authentication/error/user" style={{ color: 'white' }}>Make Family Head</Link></MenuItem>

            <MenuItem onClick={closeMenu}> <Link to="/authentication/error/Menupage6" style={{ color: 'white' }}>Merge Client</Link></MenuItem>

            <MenuItem onClick={closeMenu}> <Link to="/authentication/error/user" style={{ color: 'white' }}>Go to Front Panel</Link></MenuItem>

            <MenuItem onClick={closeMenu}><Link to="/authentication/error/user" style={{ color: 'white' }}>Login to Front Panel</Link></MenuItem>

            <MenuItem onClick={closeMenu}><Link to="/authentication/error/Menupage9" style={{ color: 'white' }}>Register/Update Client on BSE</Link></MenuItem>

            <MenuItem onClick={closeMenu}><Link to="/authentication/error/Menupage10" style={{ color: 'white' }}>Activate Direct Plan Redeem</Link></MenuItem>

            <MenuItem onClick={closeMenu}><Link to="/authentication/error/Menupage12" style={{ color: 'white' }}>Scan Mandate Download</Link></MenuItem>

            <MenuItem onClick={closeMenu}><Link to="/authentication/error/user" style={{ color: 'white' }}>Update BSE Mandate</Link></MenuItem>

            <MenuItem onClick={closeMenu}> AOF Related</MenuItem>

            <MenuItem onClick={closeMenu}><Link to="/authentication/error/Menupage11" style={{ color: 'white' }}>Recalculate/Fix Portfolio</Link></MenuItem>

            <MenuItem onClick={closeMenu}> <Link to="/authentication/error/Menupage11" style={{ color: 'white' }}>Delete All External Holdings</Link></MenuItem>

            <MenuItem onClick={closeMenu}><Link to="/authentication/error/Menupage14" style={{ color: 'white' }}>Remove Mobile PIN</Link></MenuItem>

            <MenuItem onClick={closeMenu}><Link to="/authentication/error/Menupage11" style={{ color: 'white' }}>Reset Mobile Mapping</Link></MenuItem>

            <MenuItem onClick={closeMenu}> <Link to="/authentication/error/Menupage20" >Delete transactions &amp; holdings</Link></MenuItem>

        </Menu>
    );


    return (


        <SuiBox py={5} mb={3}>


            <SuiBox display="flex" mb={3} ml={2}>
                <SuiButton variant="gradient" buttonColor="error" onClick={openMenu}>
                    <CustomerSupport size="18px" color="info" />
                    Action&nbsp;
                    <Icon className="">expand_more</Icon>
                </SuiButton>
                {renderMenu}
            </SuiBox>

        </SuiBox>


    );
}

export default Analytics;
